function FirstHead(){
    return(
        <div>
      <h1>E-Shopping</h1>
      <ul class="nav">
      <li class="active">Home</li>
      <li>Search</li>
      <li>Shop</li>
      <li>About</li>
      </ul>
        </div>
    );
}

export default FirstHead;
